		{
			bitconverter.GetBytes(msg.time_usec, bytes, offset + 0);
			bitconverter.GetBytes(msg.seq, bytes, offset + 8);
			bytes[offset + 12] = msg.target_system;
			bytes[offset + 13] = msg.target_component;
			offset += 14;
			return 4;
